import React from 'react';
import imageToAdd from "../../assets/senai-logo.png";
import { View, StyleSheet, Button, TextInput, TouchableOpacity} from 'react-native';

import { useNavigation } from '@react-navigation/native';

const email = () => {
    const [value, onChangeText] = React.useState('Email');
}
const senha = () => {
    const [value, onChangeText] = React.useState('Senha');
}


export function ScreenA() {
    const navigation = useNavigation();
  
    return (
    <View style={styles.container}>

    <View style={styles.centralize}> 
      <img src={imageToAdd} style={styles.image} alt="Image" />
    </View>

    <View style={styles.centralize}> 
        <TextInput  onChangeText={text => onChangeText(text)} style={styles.Input} />
        <TextInput style={styles.Input} />  
        <TouchableOpacity style={styles.button}/>
    </View>

    </View>
  );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: "white",
        justifyContent: "center"
    },
    centralize: {
        alignItems: 'center', 
        justifyContent: 'center',
    },
    image: {
        width: 300,
    },
    login: {

    },
    Input: {
        backgroundColor: '#f8f4f4',
        color: '#000',
        width: 250,
        height: 45,
        fontSize: 20,
        margin: 12,
        padding: 10,
    },
    button: {
        backgroundColor: '#005caa',
        color: '#7bacd4',
        borderRadius: 6,
        width: 250,
        height: 45,
        fontSize: 20,
        margin: 12,
        padding: 10,
    }
})
